@app.route('/getSentiment', methods=['POST'])
def query_records():
    if not request.json or not 'comment' in request.json:
        abort(400)
    comment = request.json['comment']
    
    analyzer = SentimentIntensityAnalyzer()
    vs = analyzer.polarity_scores(unidecode(comment))
    score = vs['compound']

    negativeWordsMatched = []
    positiveWordsMatched = []
    common_words = set()
    comment_new = clean_lemma(comment)
    # print(comment_new)
    comment_list = comment_new.split()
    comment_list = list(filter(lambda a: a != 'hotel', comment_list))
    for i, word in enumerate(comment_list):
        if i > 0 and i < len(comment_list)-1:
            w = comment_list[i-1] + ' ' + word + ' ' + comment_list[i+1]
        elif i > 0:
            w = comment_list[i-1] + ' ' + word
        elif i < len(comment_list) - 1:
            w = word + ' ' + comment_list[i+1]
        else:
            w = word
        if word in negativeSet:
            negativeWordsMatched.append(w)
        elif word in positiveSet:
            positiveWordsMatched.append(w)

        if word in common_words_set:
            common_words.add(word)

    

    size = len(comment_list)
    positive_score = len(positiveWordsMatched)*100/len(positiveSet)
    negative_score = len(negativeWordsMatched)*100/len(negativeSet)
    polarity = ''
    if score > -0.4:
        polarity = "TERRIBLE"
    elif score > -0.1:
        polarity = "BAD"
    elif score < 0.1:
        polarity = "NEUTRAL"
    elif score < 0.5:
        polarity = "GOOD"
    else:
        polarity = "GREAT"

    return jsonify({'score': score, 'length': size, 'polarity': polarity, 'positive_match': positive_score, 'negative_match': negative_score, 'positive_match_words': positiveWordsMatched, 'negative_match_words': negativeWordsMatched, 'common_matched_words': list(common_words)}), 201




